import React, { useState } from 'react';

const validate = (userData) => {
  const errors = {};
  if (!userData.email) errors.email = "Email vacío";
  else if (!/^\w+([\.-]?\w+)@\w+([\.-]?\w+)(\.\w{2,3})+$/.test(userData.email))
    errors.email = "Email inválido";

  if (!userData.password) errors.password = "Ingrese una contraseña.";
  else if (!/^(?=.\d)(?=.[a-z])(?=.*[A-Z]).{6,10}$/.test(userData.password))
    errors.password = "Contraseña inválida";

  return errors;
};

export default function Form() {
  const [userData, setUserData] = useState({
    email: '',
    password: '',
  });

  const [errors, setErrors] = useState({});
  const [isEmailValid, setIsEmailValid] = useState(true);
  const [isPasswordValid, setIsPasswordValid] = useState(true);

  const handleChange = (event) => {
    const { name, value } = event.target;
    setUserData({ ...userData, [name]: value });
    const newErrors = validate({ ...userData, [name]: value });
    setErrors(newErrors);
    setIsEmailValid(name !== 'email' || !newErrors.email);
    setIsPasswordValid(name !== 'password' || !newErrors.password);
  };

  return (
    <form>
      <div>
        <label htmlFor="email">Email:</label>
        <input
          type="email"
          id="email"
          name="email"
          value={userData.email}
          onChange={handleChange}
        />
        <span>{errors.email}</span>
        {isEmailValid && <p>Email es correcto</p>}
      </div>
      <div>
        <label htmlFor="password">Password:</label>
        <input
          type="password"
          id="password"
          name="password"
          value={userData.password}
          onChange={handleChange}
        />
        <span>{errors.password}</span>
        {isPasswordValid && <p>Password es correcto</p>}
      </div>
      <button type="submit">Submit</button>
    </form>
  );
}
